import { HttpClient, HttpContext, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';
import { filter, map } from 'rxjs/operators';
import { StrictHttpResponse } from '../../strict-http-response';
import { RequestBuilder } from '../../request-builder';

import { FoodRm } from '../../models/food-rm';

export interface SearchFood$Params {
  searchTerm?: string;
}

export function searchFood(http: HttpClient, rootUrl: string, params?: SearchFood$Params, context?: HttpContext): Observable<StrictHttpResponse<Array<FoodRm>>> {
  const rb = new RequestBuilder(rootUrl, searchFood.PATH, 'get');
  if (params) {
    rb.query('searchTerm', params.searchTerm, {});
  }

  return http.request(
    rb.build({ responseType: 'json', accept: 'text/json', context })
  ).pipe(
    filter((r: any): r is HttpResponse<any> => r instanceof HttpResponse),
    map((r: HttpResponse<any>) => {
      return r as StrictHttpResponse<Array<FoodRm>>;
    })
  );
}

searchFood.PATH = '/Food/search';
